/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `restar_stock_producto` AFTER INSERT ON `historial` FOR EACH ROW BEGIN
  DECLARE stock_actual INT;

  SELECT stockProducto INTO stock_actual
  FROM Productos
  WHERE idProducto = NEW.idProducto;

  IF stock_actual < NEW.cantProducto THEN
    SIGNAL SQLSTATE '45000'
    SET MESSAGE_TEXT = 'Stock insuficiente para el producto';
  ELSE
    UPDATE Productos
    SET stockProducto = stockProducto - NEW.cantProducto
    WHERE idProducto = NEW.idProducto;
  END IF;
END */;;
